import React from 'react'
import './header.css'
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="header">
        <span><Link to="/">home</Link></span><span><Link to="/photo_library"><img src="./photo/camera.png"/>photo</Link></span><span><Link to="/calculate">programming</Link></span>
    </div>
  )
}

export default Header
